import React from 'react';

export const Card = ({ image , name , temper , weight}) => {
  return (
    <div>
        <h3>{name}</h3>
        <h4>{temper}</h4>
        <h4>{weight}</h4>
        <img src={image} alt='Not found' width='200px' height='250px'/>
    </div>
  )
};
